import React from 'react';
import { Link } from 'react-router-dom';
import styles from './Navbar.css';
import logo from '../assets/logo.png';
import profile from '../assets/profile.png';
import history from '../assets/history.png';
import favorite from '../assets/favorite.png';

function Navbar() {
  return (
    <nav className={styles.Navbar}>
      <Link to="/" className={styles.navLink}>
        <img src={logo} alt="Logo" className={styles.navIcon} />
      </Link>

      <Link to="/history" className={styles.navLink}>
        <img src={history} alt="History" className={styles.navIcon} />
      </Link>

      <Link to="/favorite" className={styles.navLink}>
        <img src={favorite} alt="Favorite" className={styles.navIcon} />
      </Link>

      <Link to="/profile" className={styles.navLink}>
        <img src={profile} alt="Profile" className={styles.navIcon} />
      </Link>

      <Link to="/login" className={styles.navLink}>
        Login
      </Link>

      <Link to="/signup" className={styles.navLink}>
        Signup
      </Link>
    </nav>
  );
}

export default Navbar;
